class MsiBarcodeCheckDigitMode:
    '''
    MSI Barcode check digit modes.
    '''
    
    # No check digit.
    none = "none"

    # Check digit of mod 10.
    Mod10 = "mod10"

    # Check digit of mod 11.
    Mod11 = "mod11"

    # Check digit of mod 1010.
    Mod1010 = "mod1010"

    # Check digit of mod 1110.
    Mod1110 = "mod1110"
